import React from "react";
import ReactDom from "react-dom";
import * as calc from "./App";

ReactDom.render(<ol>
    <li>{calc.add(3, 2)}</li>
    <li>{calc.min(3, 2)}</li>
    <li>{calc.mul(3, 2)}</li>
    <li>{calc.divi(3, 2)}</li>
    </ol>

, document.getElementById('root'));
